allKnots :: [SX Int]
allKnots = map snd namedKnots

allLinks :: [SX Int]
allLinks = map snd namedLinks

namedObjectsFromTo :: (Enum i) => [(NamedKnot,SX i)] -> Int -> Int -> [SX i]
namedObjectsFromTo xs l u = map snd .
  dropWhile ((< l) . xingNum . fst) . takeWhile ((<= u) . xingNum . fst) $ xs
    where xingNum (x, _, _) = x

namedKnotsFromTo :: Int -> Int -> [SX Int]
namedKnotsFromTo = namedObjectsFromTo namedKnots

namedLinksFromTo :: Int -> Int -> [SX Int]
namedLinksFromTo = namedObjectsFromTo namedLinks

